export default function Header() {
  return (
    <header className="w-full">
      <nav className="w-full ">
        <button className="btn-primary">Home</button>
        <button className="btn-primary">Community</button>
        <button className="btn-primary">+</button>
      </nav>
    </header>
  );
}
